import React, { Fragment } from "react";
import mealsImage from "../../assets/meals.jpg";
import classes from "./Header.module.css";

const Header = () => {
  return (
    <Fragment>
      <header>
        <h1>ReactMeals</h1>
        <button>Cart</button>
      </header>
      <div className="">
        <img src={mealsImage} alt="A table full of delicious" />
      </div>
    </Fragment>
  );
};

export default Header;
